import React from 'react'

const Props = (props) => {
    let value=props.array
    let player;
    if(value.players.player1place==='in'){
        player=<div>P1</div>
    }
  return (
    <div className="propes">
          <div className={props.className} id= {props.id}>
            {player}
            <h1 >{props.cellNUM}</h1>
            {props.splCel}

            </div>
        </div>
  )
}

export default Props
